import React from "react";
import "./homeStyle.scss";
import { Link } from "react-router-dom";
import Button from "@material-ui/core/Button";
import Swiper from "react-id-swiper";

import "swiper/css/swiper.css";

const params = {
  pagination: '.swiper-pagination',
  effect: 'coverflow',
  grabCursor: true,
  centeredSlides: true,
  slidesPerView: 'auto',
  coverflow: {
    rotate: 50,
    stretch: 0,
    depth: 100,
    modifier: 1,
    slideShadows : true
  }
};

export default class HobbiesPage extends React.Component {
  render() {
    return (
      <div className="page-container page">
        <div className="home-page inner-container">
          <div className="welcome-container">
            <Link to="/">
              <Button>Home</Button>
            </Link>
            <Link to="/professional">
              <Button>Professional</Button>
            </Link>
          </div>
          <div>
          <Swiper {...params}>
            <img src={require("../assets/images/Web-Files/AnimationClips/abstract.png")} alt="Smiley face" height="10%" width="5%"></img>
            <div><img src={require("../assets/images/Web-Files/AnimationClips/abstract.png")} alt="Smiley face" height="300" width="300"></img></div>
          </Swiper>
          {/* <Swiper {...params}>
            <div><img src={require("../assets/images/Web-Files/AnimationClips/abstract.png")} alt="Smiley face" height="300" width="200"></img></div>
            <div><img src={require("../assets/images/Web-Files/AnimationClips/abstract.png")} alt="Smiley face" height="300" width="300"></img></div>
          </Swiper> */}
          </div>
        </div>
      </div>
    );
  }
}
